
/** 次のレベルの数 **/
function nextLevel ( element , value) {
    
    var maxStar = 10;
    var star = "";
    for (var s = 0; s < value ;s++)
    {
        star = star + "★";
    }
    for (var s = 0; s < maxStar - value ;s++)
    {
        star = star + "☆";
    }
    
    element.innerHTML = star;
}

/** ハートの数 **/
function countHearts ( element , value) {
    var maxHearts = 10;
    var heart = "";
    value = value / 1000;
    for (var h = 0; h < value ;h++)
    {
        heart = heart + '<img src="../images/likes/icon_heart.png" style="width:20px;"/>';
    }
    for (var h = 0; h < maxHearts - value ;h++)
    {
        heart = heart + '<img src="../images/likes/icon_no_heart.png" style="width:20px;"/>';
    }
    
    element.innerHTML = heart;
}
function alertMessage (message) {
    alert( message );
}

var soundList = {
cyber_se:"",
}
// クリップボードにあるbase64文字列を貼り付けます
var sebase64 = soundList.cyber_se;

function cyberSePlay() {
    // datauri scheme 形式にして Audio オブジェクトを生成します
    var sound = new Audio("data:audio/wav;base64," + sebase64);
    // 音を鳴らします
    sound.play();
}

